import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import 'bootstrap/dist/css/bootstrap.min.css'
import './DisplayList.css';


class DisplayList extends React.Component {

  constructor(props) {
    super(props);
  }
  // each of these items will have an add to cart button
  // we will filter which ones are in the cart
  render() {
    return (
      <div className="card-deck">
        {this.props.list.map(
          (item) =>
          <div className="card">
            <img className="card-img-top" src="..." alt="Card image cap"></img>
            <h3>${item.cost}</h3>
            <h3>{item.name}</h3>
            <div className="card-body">
              <div className="card-text">{item.season} Collection</div>
              <div className="card-text">{item.burntime} hours</div>
              <div className="card-text">{item.size} Wicks</div>
            </div>
          </div>
        )}
      </div>
    )
  }

}

export default DisplayList;
